async function getAllTools(): Promise<ToolWithExec[]> {
  const toolsRawData = await getAllTableData(TOOLS_TABLE_ID);

  const identifierFieldId = Number(
    toolsRawData.fields.find(field => field.label === 'identifier')?.id
  );

  const descriptionFieldId = Number(
    toolsRawData.fields.find(field => field.label === 'description')?.id
  );

  const tools = toolsRawData.data.map(tool => {
    const name = String(tool[identifierFieldId]?.value);
    const description = String(tool[descriptionFieldId]?.value);

    const TOOL = TOOLS.find(t => t.name === name);

    return {
      ...TOOL,
      name,
      description,
    };
  });

  return tools;
}

export default getAllTools;
